import ExpenseItem from "./components/ExpenseItem";

function ExpenseComponent () {
    const expenses = [
        {
          id: "e1",
          title: "Toilet Paper",
          amount: 94.12,
          date: new Date(2020, 7, 14),
        },
        { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
        {
          id: "e3",
          title: "Car Insurance",
          amount: 294.67,
          date: new Date(2021, 2, 28),
        },
        {
          id: "e4",
          title: "New Desk (Wooden)",
          amount: 450,
          date: new Date(2021, 5, 12),
        },
      ];
    return (
        <div>
        <ExpenseItem
          titleAtt={expenses[0].title}
          amountAtt={expenses[0].amount}
          dateAtt={expenses[0].date}
        />
        <ExpenseItem
          titleAtt={expenses[1].title}
          amountAtt={expenses[1].amount}
          dateAtt={expenses[1].date}
        />
        <ExpenseItem
          titleAtt={expenses[2].title}
          amountAtt={expenses[2].amount}
          dateAtt={expenses[2].date}
        />
        <ExpenseItem
          titleAtt={expenses[3].title}
          amountAtt={expenses[3].amount}
          dateAtt={expenses[3].date}
        />
      </div>
    )
}

export default ExpenseComponent
